import React from 'react'

function Job() {
    return (
        <div>
            <div>
                <p>2 days ago</p>
                <button variant="outline" className='btn rounded-4'><i class="fa fa-bookmark" aria-hidden="true"></i></button>
            </div>
        </div>
    )
}

export default Job
